-- Reverse-projection
local cloned = {}
local debounceTable = {}

-- Property change pseudo-algorithm
function requestPropertyChange(object, property, value, debounce)
	if object[property] ~= value then
		object[property] = value
		debounceTable[debounce][property] += 1
	else
		warn("Prevented property override for", object, "being", property)
	end
end

