-- clone them lol
function recursiveGuiClone(object, parent)
	--coroutine.wrap(print)("recursive gui clone called for: ", "object: ", object, "parent: ", parent)
	--TestService:Message("recursive gui clone called for: " .. "object: " .. tostring(object) .. " parent: " .. tostring(parent))
	--clone.Parent = parent
	--[[Is this object already cycled?]]
	if not table.find(cloned, object) then
		--local clone = nil
		local object = object
		local clone = object:Clone()
		clone:ClearAllChildren()
		table.insert(cloned, object)
		table.insert(cloned, clone)
		--[[Is this an interactive element?]]
		if object:IsA("GuiButton") or object:IsA("TextBox") or object:IsA("ScrollingFrame") then
			--[[Set up cloning]]
			debounceTable[clone] = {}
			debounceTable[object] = {}
			for _,o in pairs(object:GetChildren()) do
				o.Parent = clone
			end
			--[[TextBox raising]]
			if object:IsA("TextBox") then
				object.Focused:Connect(function()
					clone.CursorPosition = -1
					debounceTable[clone].CursorPosition = true
					clone.CursorPosition = object.CursorPosition
					debounceTable[object].CursorPosition = true
				end)
				--object.TextTransparency = 0
				--object.MaxVisibleGraphemes = 0
				--clone.MaxVisibleGraphemes = -1
			end
			--[[ScrollingFrame]]
			if object:IsA("ScrollingFrame") then
				debounceTable[object].CanvasPosition = 0
				local canvasToSet = object.CanvasPosition * (clone.AbsoluteCanvasSize/object.AbsoluteCanvasSize)
				if clone.CanvasPosition ~= canvasToSet then
					clone.CanvasPosition = canvasToSet
					debounceTable[object].CanvasPosition += 1
					--print("Canvas debounce: " .. debounceTable[object].CanvasPosition)
				end
--[[				object.Changed:Connect(function(prop)
					if prop == "CanvasPosition" then
						local canvasToSet = object.CanvasPosition * (clone.AbsoluteCanvasSize/object.AbsoluteCanvasSize)
