					local colorToSet = Color3.new(0.3 + object.BackgroundColor3.R * 0.7, 0.3 + object.BackgroundColor3.G * 0.7, 0.3 + object.BackgroundColor3.B * 0.7)
					if clone.BackgroundColor3 ~= colorToSet then
						clone.BackgroundColor3 = colorToSet
						debounceTable[object].BackgroundColor3 += 1
					end
				end)
				object.MouseButton1Up:Connect(function()
					if clone.BackgroundColor3 ~= object.BackgroundColor3 then
						clone.BackgroundColor3 = object.BackgroundColor3
						debounceTable[object].BackgroundColor3 += 1
					end
				end)
				object.MouseEnter:Connect(function()
					local colorToSet = Color3.new(object.BackgroundColor3.R * 0.7, object.BackgroundColor3.G * 0.7, object.BackgroundColor3.B * 0.7)
					if clone.BackgroundColor3 ~= colorToSet then
						clone.BackgroundColor3 = colorToSet
						debounceTable[object].BackgroundColor3 += 1
					end
				end)
				object.MouseLeave:Connect(function()
					if clone.BackgroundColor3 ~= object.BackgroundColor3 then
						clone.BackgroundColor3 = object.BackgroundColor3
						debounceTable[object].BackgroundColor3 += 1
					end
					--print("Current debounce count: " .. debounceTable[object].BackgroundColor3)
				end)
				--[[HoverImage / PressedImage emulation]]
				if object:IsA("ImageButton") then
					debounceTable[object].Image = 0
					object.ImageTransparency = 1
					object.MouseButton1Down:Connect(function()
						local imageToSet = clone.PressedImage or object.Image
						if clone.Image ~= imageToSet then
							clone.Image = imageToSet
							debounceTable[object].Image += 1
						end
					end)
					object.MouseButton1Up:Connect(function()
						if clone.Image ~= object.Image then
							clone.Image = object.Image
							debounceTable[object].Image += 1
						end
					end)
					object.MouseEnter:Connect(function()
						local imageToSet = clone.HoverImage or object.Image
						if clone.Image ~= imageToSet then
							clone.Image = imageToSet
							debounceTable[object].Image += 1
						end
					end)
					object.MouseLeave:Connect(function()
						if clone.Image ~= object.Image then
							clone.Image = object.Image
							debounceTable[object].Image += 1
						end
					end)
				end
			end
			--[[Bind Changed to object]]
			object.Changed:Connect(function(prop)
				-- For clone projecting changes onto object
				if prop ~= "Parent" and prop ~= "CursorPosition" and prop ~= "AbsolutePosition" and prop ~= "AbsoluteSize" and prop ~= "BackgroundColor" and prop ~= "TextColor" then
					if not debounceTable[object][prop] then
						debounceTable[object][prop] = 0
					end
					if not debounceTable[clone][prop] then
						debounceTable[clone][prop] = 0
					end
					if debounceTable[clone][prop] == 0 then
						if object:IsA("ScrollingFrame") and (prop == "CanvasPosition" or prop == "AbsoluteCanvasSize") then
							local canvasToSet = object.CanvasPosition * (clone.AbsoluteCanvasSize/object.AbsoluteCanvasSize)
							if clone.CanvasPosition ~= canvasToSet then
								clone.CanvasPosition = canvasToSet
								debounceTable[object].CanvasPosition += 1
								--print("Canvas debounce: " .. debounceTable[object].CanvasPosition)
							end
						else
							pcall(function()
								debounceTable[object][prop] += 1
								clone[prop] = object[prop]
								--print("Went thru (object changed) : ", clone:GetFullName(), object:GetFullName(), prop, object[prop], "debounce table value: " .. debounceTable[clone][prop])
							end)
						end
					else
						--print("Prevented changes (object changed) PRETTY PLEASE")
						debounceTable[clone][prop] -= 1
					end
				end
			end)
			--[[Bind Changed to clone]]
			clone.Changed:Connect(function(prop)
				-- For object projecting changes onto clone
				if prop ~= "Parent" and prop ~= "CursorPosition" and prop ~= "AbsolutePosition" and prop ~= "AbsoluteSize"  and prop ~= "BackgroundColor" and prop ~= "TextColor" then
					if not debounceTable[clone][prop] then
						debounceTable[clone][prop] = 0
					end
					if not debounceTable[object][prop] then
						debounceTable[object][prop] = 0
					end
					if debounceTable[object][prop] == 0 then
						pcall(function()
							debounceTable[clone][prop] += 1
							object[prop] = clone[prop]
							--print("Went thru (object changed) : ", clone:GetFullName(), object:GetFullName(), prop, object[prop], "debounce table value: " .. debounceTable[object][prop])
						end)
					else
						--print("Prevented changes (object changed) PRETTY PLEASE")
						debounceTable[object][prop] -= 1
					end
				end
			end)
			--[[Reparent objects]]
			clone.Parent = object.Parent
			object.Parent = parent
			
			--TODO:New_code_as_of_June2024
			object.Destroying:Connect(function()
				clone:Destroy()
			end)

			--TODO:End_of_new_code_June2024
			
			-- swap the vars for recursion
			for _, o in clone:GetChildren() do
				recursiveGuiClone(o, object)
				TestService:Message("Cloning for LC: " .. o:GetFullName() .. ", " .. object:GetFullName())
			end
			-- Bind ChildAdded to CLONE
			clone.ChildAdded:Connect(function(child)
				print("Binding uh childadded to", clone:GetFullName())
				recursiveGuiClone(child, object)
			end)
		else
			clone.Parent = parent
			object.Changed:Connect(function(prop)
				if prop ~= "Parent" and prop ~= "CursorPosition" and prop ~= "AbsolutePosition" and prop ~= "AbsoluteSize" then
					pcall(function()
						clone[prop] = object[prop]
					end)
				end
			end)
			for _, o in object:GetChildren() do
				recursiveGuiClone(o, clone)
			end
			-- Bind ChildAdded to OBJECT
			object.ChildAdded:Connect(function(child)
				print("Binding uh childadded to", object:GetFullName())
				recursiveGuiClone(child, clone)
			end)
		end
	end
end
